	add("frienemy", "{\"term\":\"frienemy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* {{blend|friend|enemy|lang\u003den}}. Likely to have been invented independently multiple times.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1998:\u0027\u0027 New Radicals, \u0026quot;You Get What You Give\u0026quot; - \u0027\u0027Frienemies\u0027\u0027 who when you\u0027re down ain\u0027t your friend\", \"priority\":1}]}, \"synonyms\":{}}");

	add("frigate", "{\"term\":\"frigate\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027frégate\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An obsolete type of sailing warship with a single continuous gun deck, typically used for patrolling, blockading, etc, but not in line of battle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A 19th c. type of warship combining sail and steam propulsion, typically of ironclad timber construction, supplementing and superseding sailing ships of the battle line until made obsolete by the development of the solely steam-propelled iron battleship\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A modern type of warship, smaller than a destroyer, originally (WWII) introduced as an anti-submarine vessel but now general purpose\", \"priority\":3}]}, \"synonyms\":{}}");

	add("frigatebird", "{\"term\":\"frigatebird\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|frigate|bird|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of five species of bird in the genus \u0027Fregata\u0027, the only genus in the family Fregatidae\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, J. P. Croxall, \u0027Seabirds: Feeding Ecology and Role in Marine Ecosystems\u0027, [http://books.google.com.au/books?id\u003dFSU9AAAAIAAJ\u0026amp;pg\u003dPA58\u0026amp;dq\u003d%22frigatebird%22%7C%22frigatebirds%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003do6txU4bQNMWolAXmkoDYCw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22frigatebird%22%7C%22frigatebirds%22\u0026amp;f\u003dfalse page 58\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Unlike most seabirds, \u0027\u0027frigatebirds\u0027\u0027 are not able to alight on the water\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Penny Olsen, Leo Joseph, \u0027Stray Feathers: Reflections on the Structure, Behaviour and Evolution of Birds\u0027, [http://books.google.com.au/books?id\u003ddIz4KORv-wUC\u0026amp;pg\u003dPA176\u0026amp;dq\u003d%22frigatebird%22%7C%22frigatebirds%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003do6txU4bQNMWolAXmkoDYCw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22frigatebird%22%7C%22frigatebirds%22\u0026amp;f\u003dfalse page 176\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The oceanic \u0027\u0027frigatebirds\u0027\u0027 are represented in Australia by three species: the Great and Lesser \u0027\u0027Frigatebirds\u0027\u0027 and endemic Christmas Island \u0027\u0027Frigatebird\u0027\u0027 (pictured\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, David Horwell, Pete Oxford, \u0027Galápagos Wildlife\u0027, 3rd Edition, [http://books.google.com.au/books?id\u003dYfrvysRy30YC\u0026amp;pg\u003dPA64\u0026amp;dq\u003d%22frigatebird%22%7C%22frigatebirds%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003do6txU4bQNMWolAXmkoDYCw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22frigatebird%22%7C%22frigatebirds%22\u0026amp;f\u003dfalse page 64\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Often called man o\u0027 war birds, they are notorious as piratical cleptomaniacs that steal food from other birds at every opportunity. This reputation is justified, but \u0027\u0027frigatebirds\u0027\u0027 are also capable of an \u0027honest\u0027 living\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"It would seem that a \u0027\u0027frigatebird\u0027\u0027 can discriminate between a bird with a full gullet and one which is empty. An unlucky booby or tropicbird may be plucked out of the air, dangled by the tail-tip and shaken until it regurgitates its food, which the \u0027\u0027frigatebird\u0027\u0027 then makes off with\", \"priority\":11}]}, \"synonyms\":{}}");

	add("fright", "{\"term\":\"fright\", \"etymology\":{\"influencers\":[{},{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"gothic\", \"low german\", \"old frisian\", \"Romanian\", \"scots\", \"Albanian\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027fright\u0027 \u0027furht\u0027 from Old english (ca. 450-1100) \u0027fryhtu\u0027 \u0027fyrhto\u0027 (fright, fear, dread, trembling, horrible sight) from Proto-germanic {{m|gem-pro|*furhtį̄||fear}}, from Proto-indo-european {{m|ine-pro|*perg-||to frighten; fear}}.Cognate with Scots \u0027fricht\u0027 (fright) Old frisian \u0027fruchte\u0027 (fright) Low german \u0027frucht\u0027 (fright) Middle dutch (ca. 1050-1350) \u0027vrucht\u0027 German \u0027furcht\u0027 (fear, fright) Danish \u0027frygt\u0027 (fear) Swedish \u0027fruktan\u0027 (fear, fright, dread) Gothic \u0027𐍆𐌰𐌿𐍂𐌷𐍄𐌴𐌹\u0027 (fear, horror, fright) Albanian \u0027frikë\u0027 (fear, fright, dread, danger) and Romanian \u0027frică\u0027 (fear, fright, dread) are also cognates, although probably influenced by an early Germanic variant.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of terror excited by the sudden appearance of danger; sudden and violent fear, usually of short duration; a sudden alarm\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, \u0027\u0027 Chapter 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"With a bolt of \u0027\u0027fright\u0027\u0027 he remembered that there was no bathroom in the Hobhouse Room. He leapt along the corridor in a panic, stopping by the long-case clock at the end where he flattened himself against the wall\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Anything strange, ugly or shocking, producing a feeling of alarm or aversion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027, Lord Byron, \u0027Don Juan\u0027, I\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Her maids were old, and if she took a new one\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"You might be sure she was a perfect \u0027\u0027fright\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"She did this during even her husband\u0027s lif\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"I recommend as much to every wife\", \"priority\":9}]}, \"synonyms\":{}}");

	add("frigidaire", "{\"term\":\"frigidaire\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Proprietary name of a brand of refrigerators.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A refrigerator\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He [...] had everything necessary to the Modern Man, / A phonograph, a radio, a car and a \u0027\u0027frigidaire\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Constance\u0027, Penguin 2004 (\u0027Avignon Quintet\u0027), p. 659\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Carpets were spread, divans appeared, as also the latest creation from Italy, a portable \u0027\u0027frigidaire\u0027\u0027 which held countless bowls of sorbet and iced lemon tea.Category:English genericized trademarks\", \"priority\":4}]}, \"synonyms\":{}}");

