	add("frill", "{\"term\":\"frill\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A strip of pleated material used as decoration or trim; a ruffle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A wrinkled edge to a film\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A luxury\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Something extraneous added for effect\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Mind you, clothes were clothes in those days. [\u0026amp;hellip;]\u0026amp;nbsp; \u0027\u0027Frills\u0027\u0027, ruffles, flounces, lace, complicated seams and gores: not only did they sweep the ground and have to be held up in one hand elegantly as you walked along, but they had little capes or coats or feather boas\", \"priority\":5}]}, \"synonyms\":{}}");

	add("frindle", "{\"term\":\"frindle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by w:Andrew Clements|Andrew Clements in his 1996 children\u0027s novel \u0027w:Frindle|Frindle\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pen\", \"priority\":1}]}, \"synonyms\":{}}");

	add("fringe", "{\"term\":\"fringe\", \"etymology\":{\"influencers\":[], \"languages\":[\"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027frenge\u0027 from {{m|la|*frimbia}}, metathesis of Latin {{m|la|fimbriae||fibers\u0026quot;, \u0026quot;threads\u0026quot;, \u0026quot;fringe}} (plural). (Cognates include German \u0027franse\u0027 and Danish \u0027frynse\u0027 )\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A decorative border\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027fringe\u0027\u0027 of a picture\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A marginal or peripheral part\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the confines of grace and the \u0027\u0027fringes\u0027\u0027 of repentanc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Those members of a political party, or any social group, holding unorthodox views\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The periphery of a town or city\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He lives in the \u0027\u0027fringe\u0027\u0027 of London\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"That part of the hair that hangs down above the eyes; bangs\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Her \u0027\u0027fringe\u0027\u0027 is so long it covers her eyes\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1915\u0027\u0027, w:W. Somerset W.S. Maugham, \u0026quot;s:Of Human Bondage/Chapter Of Human Bondage\u0026quot\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"In a few minutes Mrs. Athelny appeared. She had taken her hair out of the curling pins and now wore an elaborate \u0027\u0027fringe\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1981\u0027\u0027, Hilda Doolittle, \u0027HERmione\u0027, %22fringes%22+hair+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGFVYT42BG46WmQWrmthI\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"%22fringes%22%20hair%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 155\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Fayne in the photograph had a \u0027\u0027fringe\u0027\u0027, hair frizzed over hidden ears, sleeves over-ornate, the whole thing out of keeping\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, w:Lauraine Lauraine Snelling, \u0027Sophie\u0027s Dilemma\u0027, %22fringes%22+hair+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d5FhYT7W-AYvjmAXyts2YDw\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"%22fringes%22%20hair%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 16\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Ingeborg knew she wasn′t ready for \u0027\u0027fringes\u0027\u0027 or short hair like some of the women she′d seen, and she hoped her daughter wasn′t either\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"“No.” Astrid′s tone dismissed Sophie and the \u0027\u0027fringe\u0027\u0027 as she galloped off to a new topic\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Geraldine Biddle-Perry, Sarah Cheang, \u0027Hair: Styling, Culture and Fashion\u0027, %22fringes%22+hair+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGFVYT42BG46WmQWrmthI\u0026amp;redir_esc\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"%22fringes%22%20hair%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 231\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Set against the seductive visual and textual imagery of these soft-focus fantasy worlds, the stock list details offer the reader a very real solution to achieving the look themselves, ‘Hair, including coloured \u0027\u0027fringes\u0027\u0027 (obtainable from Joseph, £3.50) by Paul Nix’ (Baker 1972a: 68\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A light or dark band formed by the diffraction of light\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"interference \u0027\u0027fringe\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Non-mainstream theatre\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"The Fringe\u0027; \u0027Edinburgh \u0027\u0027Fringe\u0027\u0027\u0027; \u0027Adelaide \u0027\u0027Fringe\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"The peristome or fringe-like appendage of the capsules of most mosses\", \"priority\":26}]}, \"synonyms\":{}}");

	add("fringefan", "{\"term\":\"fringefan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|fringe|fan|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A science fiction fan primarily interested in a specific subset of fandom; a partial fan on the fringe of fandom\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I repeat my contention that absence of critical sense is one of the marks of the \u0027\u0027fringefan\u0027\u0027, and introduce the corollary (observable from the earliest days of anything recognizable as fandom) that argumentativeness is one of the common denominators of the [trufan] (I hate that term but it carries a useful sense\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Depends on what you want from a con, but I imagine that the name GoH attracts the \u0027\u0027fringefen\u0027\u0027 who would not come otherwise, and those people pay enough money so the con can book all the function space it wants to\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Oh, I do enjoy Ansible as well \u0026amp;lt;grovel\u0026amp;gt;. However, I wasn\u0027t sure that was a True Fanzine (tm) - after all, it\u0027s read by (shock, horror) media fans, filkers, and other such \u0027\u0027fringefen\u0027\u0027. It also uses Modern Technology, not Traditional Ways Of Producing Fanzines (not that the email version of DR is exactly traditional either\", \"priority\":4}]}, \"synonyms\":{}}");

	add("frippery", "{\"term\":\"frippery\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027friperie\u0027. From Old French \u0027fripier\u0027 (to rub up and down, to wear into rags) Compare \u0027fripper\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Ostentation, as in fancy clothing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Useless things; trifles\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1892\u0027\u0027 April, \u0027Report by F.L.O.\u0027, quoted in \u0027\u00272003\u0027\u0027, w:Erik Erik Larson, \u0027w:The Devil in the White The Devil in the White City: Murder, Magic, and Madness at the Fair that Changed America\u0027, New York, N.Y.: , ISBN 978-0-609-60844-9, page 170\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Olmsted reiterated his insistence that in Chicago] simplicity and reserve will be practiced and petty effects and \u0027\u0027frippery\u0027\u0027 avoided\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"date\u003d21 October passage\u003dw:Oscar [Oscar] Pistorius\u0027s punishment for killing her \u0026amp\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"91;\u0026amp\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"93; that night is but a \u0027\u0027frippery\u0027\u0027 when set against the burden that her bereft parents, June and Barry, must carry\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Cast-off clothes\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"edition\u003d|url\u003dhttp://books.google.com/books?id\u003dU_VDAAAAYAAJ\u0026amp;pg\u003dPA97|passage\u003dYet, if thou dost, come over, and but see our \u0027\u0027frippery\u0027\u0027; change an old shirt for a whole smock with us\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The trade or traffic in old clothes\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The place where old clothes are sold\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1610\u0027\u0027, \u0027s:The The Tempest\u0027, by w:William Shakespeare, act 4 scene\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"O, ho, monster! we know what belongs to a \u0027\u0027frippery\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Hence: secondhand finery; cheap and tawdry decoration; affected elegance\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Fond of gauze and French \u0027\u0027frippery\u0027\u0027.\u0027 \u0026amp;mdash; w:Oliver Oliver Goldsmith\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The gauzy \u0027\u0027frippery\u0027\u0027 of a French translation.\u0027 \u0026amp;mdash; w:Sir W. Sir W. Scott\", \"priority\":16}]}, \"synonyms\":{}}");

	add("frisson", "{\"term\":\"frisson\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027frisson\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sudden surge of excitement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I felt a \u0027\u0027frisson\u0027\u0027 just as they were about to announce the winner in my category\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A shiver, a thrill\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Whenever the villain\u0027s theme played in the movie I felt a sudden \u0027\u0027frisson\u0027\u0027 down my back\", \"priority\":4}]}, \"synonyms\":{}}");

